import React from "react";
import './TypeHotels.css'

const typeHotels = [
  {
    "name": "Hotels",
    "count": 233,
    "image": "./images/type_1.webp"
  },
  {
    "name": "Apartments",
    "count": 2331,
    "image": "./images/type_2.jpg"
  },
  {
    "name": "Resorts",
    "count": 2331,
    "image": "./images/type_3.jpg"
  },
  {
    "name": "Villas",
    "count": 2331,
    "image": "./images/type_4.jpg"
  },
  {
    "name": "Cabins",
    "count": 2331,
    "image": "./images/type_5.jpg"
  }
]


function TypeHotels() {
  return (
    <div>

    <div className='container-typehotels'>
      {typeHotels.map(type => (
        <div className='' key={type['name']}>
          <img src={type['image']} alt={type['name']} width='100%' height='70%'/>
          <div>{type['name']}</div>
          <div>{`${type['count']} hotels`}</div>
        </div>
      ))}
    </div>
    </div>
  )
}

export default TypeHotels
